#
# Max recursion reached for last test case.
# DP should be implemented via iteration, not recursion.
#
from typing import List
from collections import Counter

class Solution:
    def minOperations(self, nums: List[int]) -> int:
        def solve(x):
            #print(f'\tx, self.arr = {x}, {self.arr}')
            if x == 0:
                return 0
            if self.arr[x] is not None:
                return self.arr[x]
            best = float('inf')
            for n in [2, 3]:
                if x-n >= 0:
                    best = min(best, solve(x-n)+1)
            self.arr[x] = best
            return best
        cntr = Counter(nums)
        cnt = 0
        for _, v in cntr.items():
            self.arr = [None for _ in range(v+1)]
            cnt += solve(v)
        return cnt

